      prix: '3002132455',
      image: {
        v1:voiture1,
        v2:voiture2,
        v3:voiture3,
        v4:voiture4,
        v5:voiture5,
        v6:voiture6
      }
    },
    {
      id:3,
      titre: 'voiture 3',
      description: 'description de la voiture',
      prix: '3102132455',
      image: {
        v1:voiture1,
        v2:voiture2,
        v3:voiture3,
        v4:voiture4,
        v5:voiture5,
        v6:voiture6
      }
    },
    {
      id:4,
      titre: 'voiture 4',
      description: 'description de la voiture',
      prix: '3202132455',
      image: {
        v1:voiture1,
        v2:voiture2,
        v3:voiture3,
        v4:voiture4,
        v5:voiture5,
        v6:voiture6
      }
    },
    {
      id:5,
      titre: 'voiture 5',
      description: 'description de la voiture',
      prix: '4002132455',
      image: {
        v1:voiture1,
        v2:voiture2,
        v3:voiture3,
        v4:voiture4,
        v5:voiture5,
        v6:voiture6
      }
    },
    {
      id:6,
      titre: 'voiture 6',
      description: 'description de la voiture',
      prix: '4002132455',
      image: {
        v1:voiture1,
        v2:voiture2,
        v3:voiture3,
        v4:voiture4,
        v5:voiture5,
        v6:voiture6
      }
    },
    {
      id:7,
      titre: 'voiture 7',
      description: 'description de la voiture',
      prix: '4002132455',
      image: {
        v1:voiture1,
        v2:voiture2,
        v3:voiture3,
        v4:voiture4,
        v5:voiture5,
        v6:voiture6
      }
    }
  ]

  voituresIndex  = 0;

  voitureSelected = {}


  voituresShowNext (){
    let src = "";
    let voituresEls = document.querySelectorAll(".unevoiture");

    console.log(this.voituresIndex)

    if(this.voituresIndex==0){

      src = (this.voitures)[0].image.v1;
      voituresEls[0].querySelector(".voitureImg").src = src;

      src = (this.voitures)[1].image.v1;
      voituresEls[1].querySelector(".voitureImg").src = src;

      src = (this.voitures)[2].image.v1;
      voituresEls[2].querySelector(".voitureImg").src = src;

      src = (this.voitures)[3].image.v1;
      voituresEls[3].querySelector(".voitureImg").src = src;

      src = (this.voitures)[4].image.v1;
      voituresEls[4].querySelector(".voitureImg").src = src;

      src = (this.voitures)[5].image.v1;
      voituresEls[5].querySelector(".voitureImg").src = src;

      this.voituresIndex+=5
    }else{
      if((this.voituresIndex +  1) < this.voitures.length){
        src = (this.voitures)[this.voituresIndex -4].image.v1;
        voituresEls[0].querySelector(".voitureImg").src = src;

        src = (this.voitures)[this.voituresIndex -3].image.v1;
        voituresEls[1].querySelector(".voitureImg").src = src;

        src = (this.voitures)[this.voituresIndex -2].image.v1;
        voituresEls[2].querySelector(".voitureImg").src = src;

        src = (this.voitures)[this.voituresIndex -1].image.v1;
        voituresEls[3].querySelector(".voitureImg").src = src;

        src = (this.voitures)[this.voituresIndex].image.v1;
        voituresEls[4].querySelector(".voitureImg").src = src;


        this.voituresIndex++;
        src = (this.voitures)[this.voituresIndex].image.v1;
        voituresEls[5].querySelector(".voitureImg").src = src;

      }

    }

  }

  voituresShowPlus (){
    let src = "";

    let partenaire1 = (document.getElementById('partenaire1'))
    let partenaire2 = (document.getElementById('partenaire2'))
    let partenaire3 = (document.getElementById('partenaire3'))
    let partenaire4 = (document.getElementById('partenaire4'))
    let partenaire5 = (document.getElementById('partenaire5'))

    if(this.partnairesIndex!=0){
      if((this.partnairesIndex-3) > 0){
       src = (this.partenaires)[this.partnairesIndex].image;
       partenaire5.src =  src;
       src = (this.partenaires)[this.partnairesIndex-1].image;
        partenaire4.src =  src;
        src = (this.partenaires)[this.partnairesIndex-2].image;
        partenaire3.src = src;
        src = (this.partenaires)[this.partnairesIndex-3].image;
        partenaire2.src = src;
        src = (this.partenaires)[this.partnairesIndex-4].image;
        partenaire1.src = src;
        this.partnairesIndex--;
      }else{
        this.partnairesIndex = 0;
        src = (this.partenaires)[0].image;
        partenaire1.src = src;
        src = (this.partenaires)[1].image;
        partenaire2.src = src;
        src = (this.partenaires)[2].image;
        partenaire3.src = src;
        src = (this.partenaires)[3].image;
        partenaire4.src = src;
        src = (this.partenaires)[4].image;
        partenaire5.src = src;
        this.partnairesIndex+=4
      }
    }else{
      src = (this.partenaires)[0].image;
      partenaire1.src = src;
      src = (this.partenaires)[1].image;
      partenaire2.src = src;
      src = (this.partenaires)[2].image;
      partenaire3.src = src;
      src = (this.partenaires)[3].image;
      partenaire4.src = src;
      src = (this.partenaires)[4].image;
      partenaire5.src = src;
      this.partnairesIndex+=4

    }
  }

    constructor(){
      super(props);
      this.state = {date: new Date(),voitures:this.voitures};
      $("document").ready(()=>{
        this.switchV(1);
        this.voituresShowNext()
        }
      );
    }
    switchV(el){
      switch(el){
        case 1:{
          document.getElementById("vev").style.display="block";
          document.getElementById("li1").style.borderBottom="4px solid rgb(255, 208, 48)";

          document.getElementById("vel").style.display="none";
          document.getElementById("li2").style.borderBottom="0px";
          break;
        }
        case 2:{
          document.getElementById("vev").style.display="none";
          document.getElementById("li1").style.borderBottom="0px";

          document.getElementById("vel").style.display="block";
          document.getElementById("li2").style.borderBottom="4px solid rgb(255, 208, 48)";
          break;
        }
      }
    }
    hidePopup(){
      document.getElementById("popup").style.display="none";
    }
    showPopup(){
      document.getElementById("popup").style.display="block";
    }
    displayVev(){
      let tab=[{link:"",prix:"1 200 000"},{link:"",prix:"1 200 000"},{link:"",prix:"1 200 000"},{link:"",prix:"1 200 000"},{link:"",prix:"1 200 000"},{link:"",prix:"1 200 000"}];
      return tab.map((el,i)=>{
        return(
          <div onClick={()=>this.showPopup()} className="col-lg-4 col-md-4 col-xs-12 col-sm-12 imgauto">
              <div className="el" >
                <div>Marque :jfjfjfj</div>
                <div>Model :jfjfjfj</div>
                <div>Annee :jfjfjfj</div>
                <div>Kilometrage :jfjfjfj</div>
                <div>carburant :jfjfjfj</div>
                <div>Boite de vitesse :jfjfjfj</div>
                <div>prix de la voiture :jfjfjfj</div>
              </div>
              <div className="mag" style={{margin:"1.5em"}} >
                <img width="100%" src={imageyaris} alt="image yaris" />
              </div>
              <div class="row infoVoiture" >
                <div class="col-12">
                  <h6><b>Non de la voiture</b></h6>
                </div>
                <div class="col-12" style={{color:"#744A61"}}>
                    <h6><b>12000 0000</b></h6>
                </div>
              </div>
          </div>
        )
      });
    }
    old(){
      return(
      <div>
      <div onClick={()=>this.showPopup()} className="col-lg-3 col-md- col-xs-12 col-sm-12 imgauto">
      <div className="el" >
        <div>Marque :jfjfjfj</div>
        <div>Model :jfjfjfj</div>
        <div>Annee :jfjfjfj</div>
        <div>Kilometrage :jfjfjfj</div>
        <div>carburant :jfjfjfj</div>
        <div>Boite de vitesse :jfjfjfj</div>
        <div>prix de la voiture :jfjfjfj</div>
      </div>
      <div className="mag" style={{margin:"1.5em"}} >
        <img width="100%" src={imageyaris} alt="image yaris" />
      </div>
      <div>Toyota yaris 12000 0000</div>
    </div>
    <div style={{boxShadow:"10px 5px 5px grey",margin:"1.5em"}} className="col-lg-3 col-md-3 col-xs-12 col-sm-12">
      <img width="100%" src={imageyaris} alt="image yaris" />
      <div>Toyota yaris 12000 0000</div>
    </div>
    <div style={{boxShadow:"10px 5px 5px grey",margin:"1.5em"}} className="col-lg-3 col-md-3 col-xs-12 col-sm-12">
